syntax = "proto3";
import "OIFDHDIINHH.proto";
import "BattlePassUnlockStatus.proto";
import "CMKPIEPINGG.proto";
import "BattlePassRewardTag.proto";
message BattlePassSchedule {
	OIFDHDIINHH OJAFIIKBNDJ = 13;
	bool ADICGPPCJMD = 12;
	uint32 KCCLJPHKMDF = 6;
	uint32 level = 5;
	uint32 OBFPHCGIMLF = 14;
	bool GENBLPEDLKG = 11;
	BattlePassUnlockStatus unlock_status = 2;
	uint32 schedule_id = 4;
	uint32 begin_time = 1;
	uint32 AAPGBBHNFHL = 15;
	CMKPIEPINGG EDHMOGEOMKI = 7;
	uint32 end_time = 3;
	repeated BattlePassRewardTag reward_taken_list = 9;
}
